import React from "react";
import Navbar from "./Navbar";

const ActorsInfos = () => {
  const idUrl = window.location.pathname;
  const getId = (id) => {
    let idSerie = id.split("/")[2];
    return idSerie;
  };
  const id = getId(idUrl);

  return (
    <div className="actors-container">
      <Navbar />
    </div>
  );
};

export default ActorsInfos;
